INSERT INTO `qb_reply` VALUES ('674','','0','693','59','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;调心球轴承有圆柱孔和圆锥孔两种结构，保持架的材质有钢板、合成树脂等。其特点是外圈滚道呈球面形，具有自动调心性，可以补偿不同心度和轴挠度造&nbsp;调心球轴承成的误差，但其内、外圈相对倾斜度不得超过3度。<br />可承受较大的径向载荷，同时也能承受一定的轴向载荷。该类轴承外圈滚道是球面形，故具有调心性能，当轴受力弯曲或倾斜而使内圈中心线与外圈中心线相对倾斜不超过1°～2.5°时，轴承仍能工作。<br />调心球轴承内孔有圆柱形和圆锥形两种。圆锥形内孔的锥度为1：1&nbsp;2或1：30。为了加强轴承的润滑性能，在轴承外圈上加工环形油槽和三个油孔。<br /></p><table style=\"width:601px;border-collapse:collapse\" width=\"601\" height=\"589\"><colgroup><col width=\"60\" /><col width=\"57\" /><col width=\"23\" /><col width=\"27\" /><col width=\"22\" /><col width=\"42\" /><col width=\"46\" /><col width=\"49\" /><col width=\"79\" /><col width=\"90\" /><col width=\"106\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:60px;white-space:normal;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" height=\"38\" rowspan=\"2\" width=\"60\"><p>型号</p><p>圆柱孔</p></td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:57px;white-space:normal;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"38\" rowspan=\"2\" width=\"57\"><p>型号</p><p>圆锥孔</p></td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:95px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"19\" width=\"95\" colspan=\"4\">外形尺寸(mm)</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:92px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical