INSERT INTO `qb_reply` VALUES ('675','','0','694','60','1','1','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 角接触推力球轴承的特点是可以同时承受径向和轴向载荷的联合载荷，限制轴的两方面的轴向位移。它是由外圈、内圈、钢球、保持架组成，能在较高的速度下稳定地工作。安装时应注意，虽然轴承可承受双向轴向载荷，但若一侧有装球缺口时，则应注意不要让主要轴向载荷通过有缺口的一侧沟边。 ','0');
