INSERT INTO `qb_reply` VALUES ('656','','0','675','43','1','1','<p><span style=\"font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size:12px\">大连光扬轴承制造有限公司，位于中国“轴承之都”，瓦房店市北共济街17号，注册商标“ZWA”已在世界40多个国家进行注册，公司致力于“进口轴承替代”的研发制造，始终坚持“精益求精，尽善尽美，产品出现0.01%的问题就是100%的废品！”的质量方针，立志从外观、精度、使用寿命完全替代进口轴承。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;公司拥有专业的技术与服务团队，技术人员比例达30%以上，可以生产内径Φ40mm&nbsp;―&nbsp;Φ2000mm，并承接OEM及贴牌生产，公司已通过ISO9001：2000质量管理体系认证和ISO14001:2004环境管理体系认证，拥有自主进出口经营权，公司的合作伙伴包括世界上排名500强的公司，产品畅销全世界，出口到美国、西班牙、土耳其、意大利、奥地利、巴西、等十几个国家。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;公司始终坚持“社会赢、客户赢、员工赢、企业赢”的“四赢经营理念”，以客户为中心，不仅让客户满意，更要让客户感动，建立长期稳定的合作共同体，为客户省钱、为客户创造价值最大化是ZWA永恒不变的追</span>求。<br /><br /></span><img style=\"width:606px;float:none;height:254px\" title=\"光扬厂房.jpg\" border=\"0\" hspace=\"0\" vspace=\"0\" src=\"http://www_qibosoft_com/Tmp_updir/article/43/1_20131009141015_yijgq.jpg\" width=\"755\" height=\"213\" /><br /></p>','0');
INSERT INTO `qb_reply` VALUES ('677','','0','696','46','2','1','<p>调心滚子轴承滚道面的曲率中心与轴承中心一致，具有调心性能，在轴、外壳挠曲时，可自动调整，而不增加轴承负担，可承受径向负荷和双向轴向负荷，径向负荷能力大，适用于重负荷，冲击负荷的场合。此类轴承广泛应用于冶金、矿山、石油、造纸、建筑等大型机械设备。</p><table style=\"width:610px;border-collapse:collapse\" width=\"610\" height=\"608\"><colgroup><col width=\"79\" /><col width=\"72\" /><col width=\"30\" /><col width=\"31\" /><col width=\"25\" /><col width=\"47\" /><col width=\"50\" /><col width=\"49\" /><col width=\"83\" /><col width=\"79\" /><col width=\"65\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:79px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" height=\"38\" rowspan=\"2\" width=\"79\"><p>型号</p><p>圆柱型</p></td><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:72px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et2\" height=\"38\" rowspan=\"2\" width=\"72\"><p>型号</p><p>圆锥型</p></td><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:116px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et2\" height=\"19\" width=\"116\" colspan=\"4\">外形尺寸<span style=\"font-family:tahoma\" class=\"font3\">(mm)</span></td><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:100px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et2\" height=\"19\" width=\"100\" colspan=\"2\">基本负荷(KN)</td><td