INSERT INTO `qb_reply` VALUES ('676','','0','695','42','1','1','<p style=\"text-align:justify;line-height:1.5em\"><span style=\"font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size:12px\">ZWA根据ISO9001:2000标准要求，严格执行质量体系文件、从轴承产品的供应源头开始，采用工序流动卡片进行跟踪，并按照产品制造流程形成详细的质量文件，每年有两次的内审程序，确保质量体系的顺利执行。</span></span></p><p style=\"line-height:28px\"><span style=\"font-size:12px\">●&nbsp;向固定原材料供应商下订单</span></p><p style=\"margin:0cm 0cm 13px\"><strong><span style=\"font-family:&#39;微软雅黑&#39;, &#39;sans-serif&#39;;font-size:24px\">●</span></strong><span style=\"font-family:&#39;微软雅黑&#39;, &#39;sans-serif&#39;;font-size:12px\">采购、质量人员到场确定材料牌号、炉批号并拍照片</span></p><?xml:namespace prefix=\"o\"></?xml:namespace><o:p></o:p><p style=\"line-height:1.75em\"><span style=\"font-size:12px\">●&nbsp;依据原材料的合格材质单</span></p><p style=\"line-height:1.75em\"><span style=\"font-size:12px\">●&nbsp;抽样检测材料成分并获取报告<br />●&nbsp;固定FOMAS\\SHIQIANG锻造供应商进行锻造加工<br />●&nbsp;对锻件检测并出具报告<br />●&nbsp;对锻件进行调质退火热处理<br />●&nbsp;查验热处理工艺<br />●&nbsp;审验各项过程检测报告<br />●&nbsp;检查热处理后材料的性能和其它项目并拍摄照片<br />●&nbsp;供应商出具产品各项合格报告<br />●&nbsp;采购人员出具完整的采购流程报告，质量人员出具质量监控报告<br />●&nbsp;轴承锻件进入公司<br />●&nbsp;质量部门人员查看报告并抽样检查产品确认合格后办理入库手续，并存档所有检测报告便于质量追溯与持续改进。</span></p><p style=\"line-height:1.5em\">&nbsp;</p><p style=\"line-height:1.5em\">&nbsp;&nbsp;</p><p style=\"text-align:center\"><img title=\"ZWA用1(1).jpg\" src=\"http://www_qibosoft_com/Tmp_updir/article/42/1_20131010091055_uiq7v.jpg\" /></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;&nbsp;&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align:center\">&nbsp;<img style=\"width:524px;float:none;height:600px\" title=\"ZWA用2(1).jpg\" border=\"0\" hspace=\"0\" vspace=\"0\" src=\"http://www_qibosoft_com/Tmp_updir/article/42/1_20131010091033_knex0.jpg\" width=\"524\" height=\"600\" /></p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align:center\">&nbsp;</p><p style=\"text-align:center\">&nbsp;</p><p>&nbsp;</p><p style=\"text-align:center\"><img style=\"width:524px;height:600px\" title=\"ZWA