INSERT INTO `qb_reply` VALUES ('683','','0','702','53','1','1','<p>四列圆锥滚子轴承四列圆锥滚子轴承由两个双列内圈和一个双列外圈及两个单外圈组成,两内圈之间有一个内隔圈,三个外&nbsp;圈之间有两个中隔圈可以调整游隙。此轴承在承受较大的径向载荷时,可同时承受两个方向的轴向载荷,但轴&nbsp;承的允许转速不高,主要用于轧钢机的轧辊轴承。近年来该轴承开始生产带双面密封圈的结构,而且渐渐得到&nbsp;广泛应用。四列圆锥滚子轴承中小型&nbsp;的尺寸均采用轴承钢制造,大型的四列圆锥滚子轴承使用渗碳钢制造,特别大&nbsp;的尺寸使用空心滚子和支柱保持架,以增长轴承的使用寿命。<br />1.&nbsp;保持架材料四列圆锥滚子轴承一般采用钢板冲压保持架,特别大尺寸的采用支柱焊接保持架。<br />2.&nbsp;允许轴线角度误差四列圆锥滚子轴承一般不允许轴相对于外壳孔有倾斜,如有倾斜最大不超过&nbsp;2&quot;。如因生产工艺要求,作&nbsp;为轧辊轴承的四列圆锥滚子轴承承受弯辊力而轴线的倾斜超过&nbsp;2&quot;的要求时,轴承的滚子和滚道会产生额外应&nbsp;力,由此会增加轴承载荷进而缩短轴承的使用寿命。<br />3.&nbsp;公差与游隙四列圆锥滚子轴承一般为&nbsp;P0&nbsp;级公差,但也可根据用户需要生产精度等级更高的轴承。四列圆锥滚子轴承的游隙,在装配时已按安装调整规程和轴承生产协议(无生产协议按标准组游隙)调整&nbsp;好轴承游隙,用户在使用一定周期后,应该重新调整游隙,有关调整游隙的方法,请咨询&nbsp;WZZZ&nbsp;技术部门。&nbsp;4.&nbsp;径向当量动载荷当Fa/Fr≤e&nbsp;Pr=Fr+Y1Fa&nbsp;当Fa/Fr&gt;e&nbsp;Pr=0.67Fr+Y2Fa&nbsp;5.&nbsp;径向当量静载荷&nbsp;Por=Fr+Y0Fa</p><table style=\"width:641px;border-collapse:collapse\" width=\"641\" height=\"617\"><colgroup><col width=\"61\" /><col width=\"63\" /><col width=\"30\" /><col width=\"28\" /><col width=\"27\" /><col width=\"26\" /><col width=\"55\" /><col width=\"47\" /><col width=\"73\" /><col width=\"72\" /><col width=\"159\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:61px;white-space:normal;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"61\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:63px;white-space:normal;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"63\">原代号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0